import React from 'react'
import { Card } from 'antd';

const { Meta } = Card;


const ListCard = ({ data, small }) => (
  <Card
    hoverable
    style={small ? { width: 360, maxWidth: 360, maxHeight: 200, minHeight: 200 } : { width: 260, maxWidth: 260, maxHeight: 200, minHeight: 200 } }
    cover={<div alt="example" style={{ background: `url(${data.img})`, width: 300 }}></div>}
  >
    <Meta title={data.name} description={data.text} />
  </Card>
);

export default ListCard
